import Action from "../Actions";

let initialState = {
	'users': [
		{   'id': '1',
			'name': 'Vlad',
			'description': 'I\'m looking a job right now.',
			'country': 'Ukraine',
			'city': 'Kiev'},

		{   'id': '2',
			'name': 'Valera',
			'description': 'I\'m so pretty.',
			'country': 'Belarus',
			'city': 'Minsk'},

		{   'id': '3',
			'name': 'Carl',
			'description': 'I found the job.',
			'country': 'France',
			'city': 'Paris'},

		{   'id': '4',
			'name': 'Smith',
			'description': 'I\'m free to help you.',
			'country': 'USA',
			'city':  'Los Angeles'},
	]
}

const usersReducer = (state = initialState, action) => {
	switch (action.type) {
		case Action.SET_USERS: {
			let stateCopy = structuredClone(state)
			return stateCopy
		}
		default: return state
	}
}

export default usersReducer;
